import Vue from 'vue';
import Router from 'vue-router';

// 引入頁面組件
import SeatArrangement from '../components/SeatArrangement.vue';

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Home',
      component: SeatArrangement,
    },
  ]
});
